//this is the function to feed data to FlightTable from FlightSearchPage.js
function useFlights(quotes, sortLowToHigh, outboundDate, inboundDate, currentCurrency) {
    let results = []

    quotes.forEach(quote => {
        let addToList = true;

        if (addToList) {
            let rowObject = {
                OutboundCarrier: "",
                OutboundOrigin: "",
                OutboundDestination: "",
                OutboundDepartureDate: "",
                InboundCarrier: "",
                InboundOrigin: "",
                InboundDestination: "",
                InboundDepartureDate: "",
                PriceSymbol: "",
                Price: "",
                Direct: "",
            };

            
            if (quote.OutboundCarrier !== null) {
                rowObject.OutboundCarrier = quote.OutboundCarrier;
            }

            if (quote.OutboundOrigin !== null) {
                rowObject.OutboundOrigin = quote.OutboundOrigin ;
            }

            if (quote.OutboundDestination !== null) {
                rowObject.OutboundDestination = quote.OutboundDestination ;
                }
            

            if (quote.OutboundDepartureDate !== undefined) {
                rowObject.OutboundDepartureDate = quote.OutboundDepartureDate.substring(0, 10);
                rowObject.Direct = "Yes";
            }
            if (quote.InboundLeg !== undefined) {
                rowObject.InboundDepartureDate = quote.InboundLeg.DepartureDate.substring(0, 10);
            }

            rowObject.PriceSymbol = "USD"
            rowObject.Price = (quote.Price);

            results = results.concat([rowObject]);
            
        }
    })

    if (!sortLowToHigh)
        results = sortingFlights(results, sortLowToHigh);

    console.log('flight results: ', results)
    return results;
}

//this function sorts the flights
function sortingFlights(arr, sortLowToHigh) {
    let sortBy = (sortLowToHigh ? 0 : 1);
    let result = mergerSort(arr, sortBy);
    return result;
}

function merger(left, right, sortBy) {
    let arr = [];

    while (left.length !== 0 && right.length !== 0) {
        switch (sortBy) {
            case 0:
                if (left[0].Price < right[0].Price) {

                    arr.push(left.shift());
                }
                else {
                    arr.push(right.shift());
                }
                break;
            case 1:
                if (left[0].Price > right[0].Price) {
                    arr.push(left.shift());
                }
                else {
                    arr.push(right.shift());
                }
                break;
            default:
                break;
        }
    }

    let result = [...arr, ...left, ...right];

    return result;
}

function mergerSort(arr, sortBy) {

    const half = arr.length / 2
    if (arr.length < 2) {
        return arr;
    }

    const left = arr.splice(0, half);

    return merger(mergerSort(left, sortBy), mergerSort(arr, sortBy), sortBy);
}

